import React from "react";
import { Link } from "react-router-dom";

const ItemDetail = ({ProdFind}) => {
  console.log(ProdFind)
  return (
    <div>
      <img src={ProdFind.img} />
      <p>{ProdFind.id}</p>
      <p>{ProdFind?.Nombre}</p>
      <p>{ProdFind?.Precio}</p>
    <Link to={`/Prueba/${ProdFind.id}`}>
      <p>Detalle</p>
      </Link>
    </div>
  );
};

export default ItemDetail;
